import React from 'react';
import './LiveAuction.css';

const LiveAuction = () => {
  return (
    <div className="live-auction-container">
      <h2>Live Auction</h2>
      <p>Live auction feature coming soon!</p>
    </div>
  );
};

export default LiveAuction;
